import React from "react";
import Img from "../../Image/suraj.jpg";
import Style from "./Home.module.css";
import Links from "./Links";
import TypeWriterEffect from "react-typewriter-effect";
const Home = () => {
  return (
    <div>
      <div className={Style["home"]}>
        <div className={Style["home_description"]}>
          <div className={Style["home_description__brief"]}>
            <h1>Hi, I'm Suraj Poddar</h1>
            <h2>
            <TypeWriterEffect
        textStyle={{
          fontFamily: 'Red Hat Display',
          color: '#3F3D56',
          fontWeight: 500,
          fontSize: '1.5em',
        }}
        startDelay={2000}
        cursorColor="#3F3D56"
        multiText={[
          'Hey there, This is a type writer animation package',
          'it consist of two types...',
          'Single text display and multi text display',
          'Fonts can be customized.',
          'The type speed can be customized as well',
        ]}
        loop={true}
        nextTextDelay={1000}
        typeSpeed={30}
      />
            </h2>
          </div>
          <div className={Style["home_description__connect"]}>
            <Links />
          </div>
        </div>
        <div className={Style["home_avatar"]}>
          <img src={Img} alt="avatar" />
        </div>
      </div>
    </div>
  );
};

export default Home;
